import "./footer.styles.scss";

import React from "react";

function Footer() {
  return (
    <div className="footer-container">
      <p>
        <span>Credit One Peer to Peer Lending</span>  is a platform to make family and friends
        lending easy. We provide services to sign loan agreements, get monthly
        payment reminders, and facilitate automatic loan payments.
      </p>
    </div>
  );
}

export default Footer;
